// src/Components/IndiaMap.js
import React from 'react';
import './IndiaMap.css'; // Include your CSS file for styling

const IndiaMap = () => {
  const handleStateClick = (stateName) => {
    console.log(`${stateName} clicked!`);
    // You can add more actions here, like routing or state updates
  };

  return (
    <div className="india-map-container">
      <img src="/india-map.png" useMap="#india-map" alt="Map of India" className="india-map-image" />
      <map name="india-map">
        <area shape="poly" coords="100,50,110,60,120,70" alt="Andhra Pradesh" onClick={() => handleStateClick('Andhra Pradesh')} />
        <area shape="poly" coords="150,80,160,90,170,100" alt="Arunachal Pradesh" onClick={() => handleStateClick('Arunachal Pradesh')} />
        <area shape="poly" coords="200,110,210,120,220,130" alt="Assam" onClick={() => handleStateClick('Assam')} />
        {/* Add area tags for all 29 states with appropriate coords */}
        <area shape="poly" coords="..." alt="Bihar" onClick={() => handleStateClick('Bihar')} />
        <area shape="poly" coords="..." alt="Chhattisgarh" onClick={() => handleStateClick('Chhattisgarh')} />
        <area shape="poly" coords="..." alt="Goa" onClick={() => handleStateClick('Goa')} />
        <area shape="poly" coords="..." alt="Gujarat" onClick={() => handleStateClick('Gujarat')} />
        <area shape="poly" coords="..." alt="Haryana" onClick={() => handleStateClick('Haryana')} />
        <area shape="poly" coords="..." alt="Himachal Pradesh" onClick={() => handleStateClick('Himachal Pradesh')} />
        <area shape="poly" coords="..." alt="Jharkhand" onClick={() => handleStateClick('Jharkhand')} />
        <area shape="poly" coords="..." alt="Karnataka" onClick={() => handleStateClick('Karnataka')} />
        <area shape="poly" coords="..." alt="Kerala" onClick={() => handleStateClick('Kerala')} />
        <area shape="poly" coords="..." alt="Madhya Pradesh" onClick={() => handleStateClick('Madhya Pradesh')} />
        <area shape="poly" coords="..." alt="Maharashtra" onClick={() => handleStateClick('Maharashtra')} />
        <area shape="poly" coords="..." alt="Manipur" onClick={() => handleStateClick('Manipur')} />
        <area shape="poly" coords="..." alt="Meghalaya" onClick={() => handleStateClick('Meghalaya')} />
        <area shape="poly" coords="..." alt="Mizoram" onClick={() => handleStateClick('Mizoram')} />
        <area shape="poly" coords="..." alt="Nagaland" onClick={() => handleStateClick('Nagaland')} />
        <area shape="poly" coords="..." alt="Odisha" onClick={() => handleStateClick('Odisha')} />
        <area shape="poly" coords="..." alt="Punjab" onClick={() => handleStateClick('Punjab')} />
        <area shape="poly" coords="..." alt="Rajasthan" onClick={() => handleStateClick('Rajasthan')} />
        <area shape="poly" coords="..." alt="Sikkim" onClick={() => handleStateClick('Sikkim')} />
        <area shape="poly" coords="..." alt="Tamil Nadu" onClick={() => handleStateClick('Tamil Nadu')} />
        <area shape="poly" coords="..." alt="Telangana" onClick={() => handleStateClick('Telangana')} />
        <area shape="poly" coords="..." alt="Tripura" onClick={() => handleStateClick('Tripura')} />
        <area shape="poly" coords="..." alt="Uttar Pradesh" onClick={() => handleStateClick('Uttar Pradesh')} />
        <area shape="poly" coords="..." alt="Uttarakhand" onClick={() => handleStateClick('Uttarakhand')} />
        <area shape="poly" coords="..." alt="West Bengal" onClick={() => handleStateClick('West Bengal')} />
      </map>
    </div>
  );
};

export default IndiaMap;
